import React from 'react';
import './App.css';

const App = () => {
  const fetchData = async () => {
    const response = await fetch('http://localhost:8080/', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json'
      },
      // body: JSON.stringify({
      //   id: product.slug
      // })
    })
    const data = await response.json();
  }

  fetchData();

  return (
    <div className="App">
      <p>Hello world from App</p>
    </div>
  );
}

export default App;
